import React from "react";
import styled from "styled-components";
import palette from "../lib/styles/palette";

const Main = () => {
  return (
    <MainBolok>
      <Bg></Bg>
      <GradientBox>
        <MainWrap>
          <TextBox>
            <Title>Hello, I'm HyebinYoon</Title>
            <Title></Title>
          </TextBox>
        </MainWrap>
      </GradientBox>
    </MainBolok>
  );
};

const MainBolok = styled.section`
  width: 100%;
  height: 35rem;
  position: relative;
`;

const Bg = styled.div`
  position: absolute;
  background: url("../images/main-bg2.jpg");
  background-size: cover;
  width: 100%;
  height: 100%;
  background-position: center;
`;

const MainWrap = styled.div`
  max-width: 70rem;
  width: 100%;
  margin: 0 auto;
  height: 100%;
`;

const GradientBox = styled.div`
  width: 100%;
  display: flex;
  position: absolute;
  display: flex;
  flex-direction: column;
  position: absolute;
  bottom: 0;
  height: 12rem;
  background: linear-gradient(
    360deg,
    rgba(0, 0, 0, 1) 8.98%,
    rgba(0, 0, 0, 0) 100%
  );
`;

const TextBox = styled.div``;

const Title = styled.div`
  color: ${palette.text_white};
`;
export default Main;
